import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
     <Router>
      <Navbar />
      <Routes>
        <Route path="/" element={<Home />} />
        <Route path="/blog" element={<Blog />} />
        <Route path="/blog/:itemId" element={<BlogItem />} />
      </Routes>
    </Router>

    </div>
  );
}

export default App;
